window.datatablesInterop={initialiseDataTable:function(n,t){const i=JSON.parse(t);for(let n=0;n<i.columns.length;n++){const t=i.columns[n];t.createdCell=this.assignCallback(t.createdCell);t.render=this.assignCallback(t.render)}i.ajax!=null&&(i.ajax.data=this.assignCallback(i.ajax.data),i.ajax.dataSrc=this.assignCallback(i.ajax.data));$(n).DataTable(i)},destroyDataTable:function(n){$(n).DataTable().destroy()},assignCallback:function(n){if(n==null||n.namespace==null||n.function==null)return undefined;const t=window[n.namespace];if(t===null||t===undefined)return undefined;const i=t[n.function];return typeof i=="function"?i:undefined}};